import React from 'react';
import { Link } from 'react-router-dom';
export default function Login() {
  return (
    <div className="table">
      <h2>Hello again!</h2>
      <button>Google</button> <button>Yandex</button> <button>GitHub</button>
      <input placeholder="Login" />
      <input placeholder="Password" type="password" />
      <Link to="/slider"><button>Log in</button></Link>
      <p style={{ marginTop: '12px' }}>or <a href="/join">join us</a></p>
    </div>
  );
}
